import React from 'react';

const NGODashboard = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h2>NGO Dashboard</h2>
      <p>Welcome to your NGO dashboard!</p>
    </div>
  );
};

export default NGODashboard;
